// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

contract BaoBuaKeo{
    address public Player1;
    address public Player2;
    mapping (address => uint) moneyDeposit;
    uint public basemoney;

    modifier requireDeposit(uint _amount) {
        require(_amount >= basemoney);
        _;
    }

    modifier validAccount {
        require(msg.sender != address(0));
        _;
    }



    function register(uint _amount) public requireDeposit(_amount) validAccount {
        if (Player1 == address(0)) {
            Player1 = msg.sender;
            moneyDeposit[msg.sender] = _amount;
        } 
    }   
    // register - deposit
